(786, 1, 'admin/news-posts', 'POST', '::1', '{\"post_category_id\":\"3\",\"title\":\"IUIU bids farewell to Dr. Ahmed Ssengendo\",\"description\":\"The long serving rector of the Islamic University In Uganda (IUIU), Dr. Ahmed Kawesa Ssengendo, has ended his 33 years of service at the second oldest university in the country.\",\"details\":\"<p>The long serving rector of the Islamic University In Uganda (IUIU), Dr. Ahmed Kawesa Ssengendo, has ended his 33 years of service at the second oldest university in the country.<\\/p><p>Ssengendo was recently appointed Assistant Secretary General at the Organisation of Islamic Cooperation in Jeddah Saudi Arabia.<\\/p><p>While bidding farewell at the main campus in Mbale, Ssengendo pledged to use his new office to promote the the university.<\\/p><p>Dr. Ssengendo is among the pioneer lecturers at IUIU. He left Makerere University to start IUIU from scratch in 1987.<\\/p><p>He joined the university as a lecturer before rising through the ranks to become the rector, the university\\u2019s top job, a position he held for 16 years.<\\/p><p>Earlier this year, Ssengendo was appointed the Assistant Secretary General of the Organisation of Islamic Cooperation.<\\/p><p>Bidding farewell to the longest serving boss, his peers and old students described him as a man of unique character and strong leadership skills<\\/p><p>Ssengendo challenged his successor, Dr. Ismail Simbwa Gyagenda to uphold the values that the university stands for such as integrity and solving community problems.<\\/p><p>He leaves behind a master plan upon to guide the further development of IUIU .<\\/p><p>Other achievements include; expanding the university\\u2019s academic menu, academic excellence and maintaining discipline among staff and students.<\\/p><p>The university has not experienced any strike during his 16 years of leadership.<\\/p><p>Dr Gyagenda pledged to preserve and further his predecessor\\u2019s legacy.<\\/p><p>IUIU is Uganda\\u2019s second oldest university and the first to be established outside Kampala.<\\/p><p>It is the only private university established by an Act of Parliament.<\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"LYS6xqO38YNx8IIznkpnzlOkmDs6SY1MYFpBevGf\",\"_previous_\":\"http:\\/\\/localhost\\/alumni\\/admin\\/news-posts\"}', '2023-01-01 16:42:46', '2023-01-01 16:42:46'),
(787, 1, 'admin/news-posts', 'GET', '::1', '[]', '2023-01-01 16:42:46', '2023-01-01 16:42:46'),
