(795, 1, 'admin/news-posts', 'POST', '::1', '{\"post_category_id\":\"2\",\"title\":\"Chairman of the IUIUAA with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus\",\"description\":\"The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.\",\"details\":\"<p>The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.<\\/p><p><img src=\\\"https:\\/\\/iuiuaa.org\\/wp-content\\/uploads\\/2021\\/02\\/iuiu_campus-2-1024x683.jpg\\\"><\\/p><p>Mr. Abdul Noor Sekindi, the Chairman IUIUAA led a delegation of IUIU Alumni Interim Executive Committee to the IUIU Kampala campus where they met the Rector of IUIU, Prof Dr. Ismail Simbwa Gyagenda and Dr. Serwanga Jamilu, the Vice Rector Academic Affairs.<\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"LYS6xqO38YNx8IIznkpnzlOkmDs6SY1MYFpBevGf\",\"_previous_\":\"http:\\/\\/localhost\\/alumni\\/admin\\/news-posts\"}', '2023-01-01 16:54:25', '2023-01-01 16:54:25'),
