(801, 1, 'admin/news-posts', 'POST', '::1', '{\"post_category_id\":\"2\",\"title\":\"The 1st guild president meeting with Islamic University In Uganda Alumni Association\",\"description\":\"The Islamic university in Uganda alumni association(IUIUAA) executives arranged for a meeting with the alumni guild presidents, which purpose was basically to mobilize the former guild presidents of the mighty university to be one unit and also inform them about the upcoming alumni dinner event due to take place on 12th\\/02\\/2022 at spekes Resort Munyonyo.\",\"details\":\"<p>The Islamic university in Uganda alumni association(IUIUAA) executives arranged for a meeting with the alumni guild presidents, which purpose was basically to mobilize the former guild presidents of the mighty university to be one unit and also inform them about the upcoming alumni dinner event due to take place on 12th\\/02\\/2022 at spekes Resort Munyonyo.<\\/p><p>The meeting was a successful one with good participation and important issues were raised by the Excellences which was discussed and we hope will lead to the success of the dinner, the major concern of the dinner was mobilization, calling upon the guild presidents to mobilize others both their cohorts and alumni\\u2019s under their term of office.<\\/p><p>Both the IUIUAA chairman and the IUIU AA dinner chairman gave brief communications about the dinner which gave a full package of the dinner thus the purpose, objectives and theme of the dinner.<\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"LYS6xqO38YNx8IIznkpnzlOkmDs6SY1MYFpBevGf\",\"_previous_\":\"http:\\/\\/localhost\\/alumni\\/admin\\/news-posts\"}', '2023-01-01 17:03:00', '2023-01-01 17:03:00'),
