(952, 1, 'admin/news-posts', 'POST', '::1', '{\"post_category_id\":\"2\",\"title\":\"CREATING INVESTMENT OPPORTUNITIES THROUGH SOCIAL SYNERGIES\",\"description\":\"Alumni Homecoming Dinner is aimed at bringing a strong IUIU community to come together not only to reflect on the journey of IUIU but also to reconnect and celebrate the university\\u2019s tremendous achievements spanning across different disciplines and above all to start an investment club and construct a girls\\u2019 hostel at Islamic University in Uganda Females\\u2019 Campus (IUIUFC) Kabojja.\",\"details\":\"<p class=\\\"ql-align-justify\\\">Islamic University in Uganda (IUIU) will prepare a homecoming dinner, inviting all alumni to buy tickets to contribute to their alma mater. The event will take place at the Islamic University in Uganda Females\\u2019 Campus (IUIUFC) from 2:00 pm-9:00 pm. <strong>The dinner is one of the events organized by the <\\/strong>alumni association other events included environmental activities 25-27<sup>th<\\/sup> November 2022. The sports gala and team building exercises will take place on 4<sup>th<\\/sup> February 2023, Health Caravans will be on each major event, and Daawa activities on 6<sup>th<\\/sup> February 2023.<\\/p><p class=\\\"ql-align-justify\\\">Alumni Homecoming Dinner is aimed at bringing a strong IUIU community to come together not only to reflect on the journey of IUIU but also to reconnect and celebrate the university\\u2019s tremendous achievements spanning across different disciplines and above all to start an investment club and construct a girls\\u2019 hostel at Islamic University in Uganda Females\\u2019 Campus (IUIUFC) Kabojja.<\\/p><p class=\\\"ql-align-justify\\\">The event will be organized under the theme \\u201c<strong>CREATING INVESTMENT OPPORTUNITIES THROUGH SOCIAL SYNERGIES\\u201d<\\/strong>. With over 30,000 graduates educated since its inception in 1988, IUIU has one of the largest and most resourceful Alumni in Uganda and the world over.<\\/p><p class=\\\"ql-align-justify\\\">The event will host students, stakeholders, former students leaders, alumni, top university management, the university community, and invited guests. Participation is by the purchase of tickets ranging from 100,000\\/- standard, 200,000\\/- silver, 500,000\\/- Gold, 1,000,000\\/- Table, and 2,000,000\\/-Vip Table, for students with the proceeds going towards Rebuilding IUIU\\u2019s Infrastructures and students\\u2019 scholarship fund to help financially disadvantaged students towards payment of tuition fees.<\\/p><p class=\\\"ql-align-justify\\\">The homecoming dinner is an opportunity for the alumni to reflect and think of how they could be part of IUIU\\u2019s journey for the next 30 years. It will be a moment to recognize, laud, and celebrate the contributions of those who were and continue to be instrumental in the university\'s success.<\\/p><p class=\\\"ql-align-justify\\\">IUIU Alumni association and IUIU Regroup 2000, invite you to attend the homecoming dinner as we continue to move together and with IUIU as they continue celebrating #IUIU@34.<\\/p><p class=\\\"ql-align-justify\\\">&nbsp;<\\/p><p class=\\\"ql-align-justify\\\">Author <\\/p><p>Nabukeera Madinah Sebyala (PhD)<\\/p><p>Director Islamic University in Uganda Females Campus Kabojja<\\/p><p>Senior lecturer -Department of Public administration <\\/p><p>Faculty of management studies.<\\/p><p class=\\\"ql-align-justify\\\">E-Mail: <a href=\\\"mailto:nabmaidah@gmai.com\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(5, 99, 193);\\\">nabmaidah@gmail.com<\\/a><\\/p><p class=\\\"ql-align-justify\\\">Mob. +256776360170\\/ +256757720500<\\/p><p class=\\\"ql-align-justify\\\">&nbsp;<\\/p><p class=\\\"ql-align-justify\\\">&nbsp;<\\/p><p><br><\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"LYS6xqO38YNx8IIznkpnzlOkmDs6SY1MYFpBevGf\",\"_previous_\":\"http:\\/\\/localhost\\/alumni\\/admin\\/news-posts\"}', '2023-01-01 23:10:36', '2023-01-01 23:10:36'),
