(1891, 1, 'admin/events/1', 'PUT', '127.0.0.1', '{\"title\":\"Wakiso persons with disabilities grand dinner Grand Dinner - 2023\",\"theme\":\"Creating investigate opportunities through social synergies\",\"event_date\":\"2023-02-10\",\"details\":\"<p class=\\\"ql-align-justify\\\">Islamic University in Uganda (IUIU) will prepare a homecoming dinner, inviting all alumni to buy tickets to contribute to their alma mater. The event will take place at the Islamic University in Uganda Females\\u2019 Campus (IUIUFC) from 2:00 pm-9:00 pm. <strong>The dinner is one of the events organized by the <\\/strong>alumni association other events included environmental activities 25-27<sup>th<\\/sup> November 2022. The sports gala and team building exercises will take place on 4<sup>th<\\/sup> February 2023, Health Caravans will be on each major event, and Daawa activities on 6<sup>th<\\/sup> February 2023.<\\/p>\",\"venue_name\":\"IUIU Female\'s campus - Kaboja\",\"address\":\"Kabojja, Nateete, Kampala\",\"gps_latitude\":\"0.292165\",\"gps_longitude\":\"32.514309\",\"speakers\":{\"1\":{\"name\":\"Dr. Mwebesa Umar\",\"designation\":\"Co-Founder, Invision LTD\",\"details\":\"<h3 class=\\\"ql-align-center\\\"><strong>Dr. Mwebesa Umar<\\/strong><\\/h3><p><br><\\/p>\",\"id\":\"1\",\"_remove_\":\"0\"},\"2\":{\"name\":\"Hajjat Aisha Nakibuule\",\"designation\":\"Senior Project Manager, Uber\",\"details\":\"<p>Hajjat Aisha Nakibuule<\\/p>\",\"id\":\"2\",\"_remove_\":\"0\"},\"3\":{\"name\":\"Abdunur M. Sekindi\",\"designation\":\"Product Manager, Google\",\"details\":\"<h3 class=\\\"ql-align-center\\\"><strong>Abdunur M. Sekindi<\\/strong><\\/h3><p><br><\\/p>\",\"id\":\"3\",\"_remove_\":\"0\"}},\"tickets\":{\"1\":{\"user_id\":\"1\",\"name\":\"Standard\",\"price\":\"100000\",\"availability\":\"500\",\"details\":\"Standard\",\"id\":\"1\",\"_remove_\":\"0\"},\"2\":{\"user_id\":\"1\",\"name\":\"Silver\",\"price\":\"200000\",\"availability\":\"500\",\"details\":\"Silver\",\"id\":\"2\",\"_remove_\