(1908, 1, 'admin/news-posts/3', 'PUT', '127.0.0.1', '{\"post_category_id\":\"2\",\"title\":\"Chairman of ICT for persons with disabilities meets delegates from UCC\",\"description\":\"The chairman (Mr. Abdulnur sekindi) of the Islamic University in Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting with Islamic University alumni medical students working in different health unities within the country among them are; Dr. Mpungu Amirah, Dr.Nakawesa Amina Ismail, Dr.Ssaka Mustafa and Dr.Nabukeera Aisha Masimbi\",\"details\":\"<p>The chairman (Mr. Abdulnur sekindi) of the Islamic University in Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting with Islamic University alumni medical students working in different health unities within the country among them are; Dr. Mpungu Amirah, Dr.Nakawesa Amina Ismail, Dr.Ssaka Mustafa and Dr.Nabukeera Aisha Masimbi<\\/p><p>The chairman called upon the alumni medical students to organize themselves, and mobilize others alumni doctors working in different health facilitates within the country to come up with a unifying body that identifies all the alumni doctors of the Islamic university in Uganda.<\\/p><p><img src=\\\"https:\\/\\/iuiuaa.org\\/wp-content\\/uploads\\/2021\\/05\\/WhatsApp-Image-2021-05-20-at-16.23.42.jpeg\\\"><\\/p><p>He also appealed to the alumni medical students to show commitment to the association and this will create more opportunities, connections and social networking among the entire alumni body. On his other statement he promised to appoint two representatives of the alumni medical students to be on the interim committee and they will act as a bridge for the medical alumnus.<\\/p><p>Mrs. Aisha Nambooze (Member IUUAA) committee emphasized on mobilization, commitment, social networking and encouraged the medical alumnus to be fully available for the activities of the association, she assigned the medical students a responsibility of mobilizing atheist 50 alumni\\u2019s by 20<sup>th<\\/sup>\\\\JUNE\\\\2020.<\\/p><p><img src=\\\"https:\\/\\/iuiuaa.org\\/wp-content\\/uploads\\/2021\\/05\\/WhatsApp-Image-2021-05-20-at-16.23.43.jpeg\\\"><\\/p><p>Ms. Chebukwa Shukur, the current IUIU alumni administrator encouraged the medical alumnus to be competitive, outstanding and represent the entire body of the medical students of the Islamic university in Uganda and this would give good leadership to the current medical students of the Islamic university in Uganda.<\\/p><p>The medical alumnus requested for support, mentorship and cooperation from the chairman and his entire team and also briefed the chairman about the challenges and competition they are facing with other medical alumnus from different institutions.<\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"0Zh2vHAJ4C9ouPaNWd1UQ0KpwkpBJ7ZxCP30N9XY\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/news-posts\"}', '2023-02-26 21:07:52', '2023-02-26 21:07:52'),
(1909, 1, 'admin/news-posts', 'GET', '127.0.0.1', '[]', '2023-02-26 21:07:52', '2023-02-26 21:07:52'),
