(1911, 1, 'admin/news-posts/2', 'PUT', '127.0.0.1', '{\"post_category_id\":\"2\",\"title\":\"Chairman of ICT for persons with disabilities meets delegates from 8Tech\",\"description\":\"The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.\",\"details\":\"<p>The Chairman of the Islmic University In Uganda Alumni Association (IUIUAA) with other members of the interim committee meeting the Rector and VC Rector Academic Affairs at the IUIU Kamapala campus.<\\/p><p><img src=\\\"https:\\/\\/iuiuaa.org\\/wp-content\\/uploads\\/2021\\/02\\/iuiu_campus-2-1024x683.jpg\\\"><\\/p><p>Mr. Abdul Noor Sekindi, the Chairman IUIUAA led a delegation of IUIU Alumni Interim Executive Committee to the IUIU Kampala campus where they met the Rector of IUIU, Prof Dr. Ismail Simbwa Gyagenda and Dr. Serwanga Jamilu, the Vice Rector Academic Affairs.<\\/p>\",\"administrator_id\":\"1\",\"views\":\"0\",\"_token\":\"0Zh2vHAJ4C9ouPaNWd1UQ0KpwkpBJ7ZxCP30N9XY\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/news-posts\"}', '2023-02-26 21:08:40', '2023-02-26 21:08:40'),
